This is a list of basic subjects for which Wikipedia should have a corresponding high-quality article, and ideally a featured article. It also serves as a [[Special:Recentchangeslinked/Wikipedia:Vital articles|centralized watchlist]] and tracks the status of some of Wikipedia's most essential articles.
Ideally this page should list approximately 1,000 of the most vital Wikipedia articles.
